import React from "react";
import NavBar from "./NavBar";
import { useEffect, useState } from "react";
export default function Rovers() {
    const [photoData1, setPhotoData] = useState(null);
    useEffect(() => {

        fetchPhoto();

        async function fetchPhoto(){

            const res =  await fetch (
                'https://api.nasa.gov/EPIC/api/natural/date/2019-05-30?api_key=DEMO_KEY'
            );
            const data = await res.json();
            setPhotoData(data);
            console.log(data);
}
}, []);
    return (
        <>
        <NavBar />
        <div className="nasa-photo">
            {photoData1.media_type = "image" ? (
            <img src ={photoData1.image} alt ={photoData1.title}/>
            ) : (
                <iframe className="video">
                title = {photoData1.title}
                src = {photoData1.image}
                frameBorder = "0"
                gesture = "media"
                allow = "encrypted-media"
                allowFullScreen
                className = "photo"        
                </iframe>
            )
            }   
            <div>
                <h1>{photoData1.image}</h1>
                <p>{photoData1.date}</p>
                <p>{photoData1.explanation}</p>
            </div>
        </div>
        <div className="heading">
            <h1>Rovers</h1>
        </div>
        </>
    )
}
